import PropTypes from "prop-types";

const Card = ({ children, reverse }) => {
    return <div className={`card ${reverse && "reverse"}`}>{children}</div>;
};

Card.defaultProps = {
    reverse: false,
};

Card.propTypes = {
    children: PropTypes.node,
    reverse: PropTypes.bool,
};

export default Card;
